import React from 'react';
import MainStack from '../MainStack/MainStack';


function Promo({children}) {
    return (
        <MainStack 
            stackName = {''} 
            title = {'Учебный проект студента факультета Веб-разработки.'}
        >
            {children}
        </MainStack> 

    );
}

export default Promo;
